const __pageData = JSON.parse('{"title":"Curriculum sequencing for the fundamental theorem of calculus","description":"","frontmatter":{"title":"Curriculum sequencing for the fundamental theorem of calculus"},"headers":[],"relativePath":"blog/200804-sequencing-the-fundamental-theorem-of-calculus.md","filePath":"blog/200804-sequencing-the-fundamental-theorem-of-calculus.md"}');
